                  "拉布拉多犬和人一样，在成长的过程中难免会受伤害、生病、误食等等，对于初次养狗的人来说，遇到意外时，确实会有点手忙脚乱，许多人也都没想过狗狗会像人类一样会生病。遇到紧急情况的时候我们应找到病因或及时送医治疗。\n\t\t\t\t　　中毒的拉布拉多是什么症状?\n\t\t\t\t　　拉布拉多狗狗吃了腐败变质的食物或者药品，特别是吃了被药死的老鼠时就会中毒。判断狗狗中毒的几条凭据：\n\t\t\t\t　　1.行为异常：拉布拉多犬出现颤抖，身体倾斜无法保持平衡，精神焦虑不安，拉布拉多犬不停地流涎，癫痫发作，甚至失去意识。\n\t\t\t\t　　2.流血：灭鼠的药物会使动物的血液凝固功能受到抑制。因此，拉布拉多犬误食了鼠药的狗在眼、耳、鼻、口会不停地流血。\n\t\t\t\t　　3.拉布拉多犬会出现呼吸困难、喘不过气或开口呼吸等症状。\n\t\t\t\t　　发现狗狗有中毒症状的时候最好看一看家里少了什么，拉布拉多犬周围有什么可疑物品没有，这样可以初步知道中毒的原因，带着拉布拉多犬去医院时好告诉医生，做到对症下药。\n\t\t\t\t　　我们是很爱自己的宠物的，虽然在最开始的时候，我们也许并不是很喜欢拉布拉多，或许最开始的时候，我们喜欢的是博美、是比熊狗，但是只要是相处过一段时间我们就会发现，其实，拉布拉多也是很可爱的，同时我们也希望能够把它饲养的健康茁壮。如果他生病了或者是发生什么意外，我们也会很难过的。\n\t\t\t\t　　当拉布拉多狗狗发生抽筋的现象时，主人千万别慌张，自己要先冷静下来，才能帮助拉布拉多犬度过紧急时刻。\n\t\t\t\t　　表现：拉布拉多犬不停抽搐、身体僵硬、嘴巴时开时闭、舌头往外掉。\n\t\t\t\t　　处理方法：先别碰触拉布拉多犬的身体，并且在第一时间里赶紧将拉布拉多犬身旁的物品移开，以免拉布拉多狗狗在抽筋的过程中，误撞到其他东西。\n\t\t\t\t　　此时，一面确认拉布拉多犬的呼吸是否正常，一面等待拉布拉多犬平静下来;当它恢复平静之后，立即把狗狗的颈链和项圈拿下来，并且赶紧送往动物医院，并详细向兽医描述狗狗当时抽搐的过程和现象。\n\t\t\t\t　　拉布拉多宝宝晕车怎么办？\n\t\t\t\t　　晕车不能算病，所造成的后果也并不严重。当拉布拉多狗狗坐车时呕吐就可能是晕车了，让它安静下来，休息一会儿就会适应。有的狗狗晕过几回车后就再也不会晕车了。如果你的拉布拉多猎犬也有晕车的习惯，在出行前不要让它进食和饮水，并服治晕车的药。\n\t\t\t\t　　对于昆虫叮咬的过敏反应，主要表现为荨麻疹，拉布拉多狗狗可能会出现呼吸困难。应当立即联络兽医。\n\t\t\t\t　　黄蜂叮咬：它的毒液是碱性的，因此应当采用弱酸来冲洗伤口，如食醋。蜜蜂叮咬：尽量用镊子除掉鳌针，它看上去就像黑色的短发。蜜蜂叮咬是酸性的，可用肥皂水冲洗。\n\t\t\t\t　　螨虫虱子叮咬：会引起皮肤病，即时治疗、剃毛、药浴、驱虫一般没多大事。"
