                  "大家都在提倡给波斯猫健康科学合理地喂食，但真正能做到的主人却没几个。帮助波斯猫养成良好的饮食习惯不仅可以让它们拥有健康的身体，还能给主人减少不少麻烦，比如猫咪如果因为食物问题造成各种疾病的出现，主人破财费力不说，猫咪还得承受疾病带来的痛苦。如果你购买了一只波斯猫，那么在它们喂食时必须注意以下六点：\n\t\t\t\t\n\t\t\t\t       一、不要轻易更换食盆\n\t\t\t\t\n\t\t\t\t       猫的食盘要固定使用，不能随便更换。猫对食盘的变换很敏感，有时因换了食盘而拒食。要保持食盘的清洁。食盘底下可垫上报纸或塑料纸等，防止食盘滑动时的声响，而且也易于清扫。每次猫吃剩的食物要倒掉或收起来，待下次喂食时和新鲜食物混合煮熟后喂给。\n\t\t\t\t\n\t\t\t\t       二、喂食要定时定点\n\t\t\t\t\n\t\t\t\t       猫“开饭”的生物钟一旦形成，就比较固定，不应随意变更。放猫食的地方要固定, 猫不喜欢在吵杂声中和强光照射的地方吃食，如果有客人来访，不要在猫吃食时让客人看你的猫，陌生人的出现，会大大降低猫的食欲。\n\t\t\t\t\n\t\t\t\t       三、让猫咪吃食盆中的食物\n\t\t\t\t\n\t\t\t\t       猫有用爪钩取食物或把食物叼到食盘外边吃的不良习惯。 一旦发现这种现象，要立即调教，使其改正。\n\t\t\t\t\n\t\t\t\t       四、温热的食物最受猫咪喜欢\n\t\t\t\t\n\t\t\t\t猫喜食温热的食物。凉食、冷食不但影响猫的食欲，还易引起消化功能紊乱。一般情况下，食物的温度以30～40度为宜，从冰箱内取出的食物，要加热后再喂。猫有时候也会吃草，促进消化。\n\t\t\t\t\n\t\t\t\t       五、保证充足的饮水\n\t\t\t\t\n\t\t\t\t       猫虽然饮水不多,但一定要备有充足的清洁饮水。猫饮用水必须是清水，而且每天都要换水。饮水盆可放在食盘一侧，以便猫口渴时自由饮用。\n\t\t\t\t\n\t\t\t\t       六、随时注意观察猫的食欲\n\t\t\t\t\n\t\t\t\t       影响猫食欲的原因很多，主要有饲料、环境和疾病三大原因。如果猫的食物单一、不新鲜，或者食物的气味、浓度、味道不对胃口等，猫会拒食。如果把猫饲料调配得花样多一些、适口性好些，能使猫始终保持很高的食欲。另外，食物的味道不要太谈，也不要太咸。猫喜吃甜食或有鱼腥味的食物。此外，强光、喧闹、有陌生人在场或有其他动物干扰等均可影响猫的食欲。若这两个因素都改善了，猫的食欲仍不好转，那可能是猫生病了，这时要及时请兽医诊治。\n\t\t\t\t\n\t\t\t\t       让猫咪养成良好的饮食习惯并不是一天两天就能完成的，在这个过程中，主人很容易碰到猫咪不配合的问题，在如果碰到这样的情况，主人一定不要心软，坚持让猫咪做到你规定的事情才是真正对它们的生活负责。"
